import React from "react";
import "./ChatRoom.css";
import NavTopRoom from "./NavTopRoom/NavTopRoom";
import InChat from "./InChat/InChat";
import NavFixBottom from "./NavFixBottom/NavFixBottom";

class ChatRoom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="chatroom">
        <div className="row">
          <div className="col">
            <div className="row">
              <div className="col-lg nav-room">
                <NavTopRoom />
              </div>
            </div>
            <div className="row">
              <div className="col-lg inchat">
                <InChat/>
              </div>
            </div>
            <div className="row">
            <NavFixBottom/>
              {/* <div className="col-lg">
                <NavFixBottom/>
              </div> */}
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ChatRoom;
